e -->\n\nWindowControlsComponent->SettingsModule\n\n\n\nTabsModule -->\n\nSettingsModule->TabsModule\n\n\n\n\n\nAdvancedComponent \n\nAdvancedComponent \n\nAdvancedComponent  -->\n\nSettingsModule->AdvancedComponent \n\n\n\n\n\nBackgroundComponent \n\nBackgroundComponent \n\nBackgroundComponent  -->\n\nSettingsModule->BackgroundComponent \n\n\n\n\n\nSettingsComponent \n\nSettingsComponent \n\nSettingsComponent  -->\n\nSettingsModule->SettingsComponent \n\n\n\n\n\nShellComponent \n\nShellComponent \n\nShellComponent  -->\n\nSettingsModule->ShellComponent \n\n\n\n\n\nTabSettingsComponent \n\nTabSettingsComponent \n\nTabSettingsComponent  -->\n\nSettingsModule->TabSettingsComponent \n\n\n\n\n\nSettingsService\n\nSettingsService\n\nSettingsModule -->\n\nSettingsService->SettingsModule\n\n\n\n\n\nSplitPanelComponent\n\nSplitPanelComponent\n\nTabsModule -->\n\nSplitPanelComponent->TabsModule\n\n\n\n\n\nTabsComponent\n\nTabsComponent\n\nTabsModule -->\n\nTabsComponent->TabsModule\n\n\n\n\n\nTaskListModule\n\nTaskListModule\n\nTabsModule -->\n\nTaskListModule->TabsModule\n\n\n\nTerminalModule -->\n\nTaskListModule->TerminalModule\n\n\n\n\n\nTaskListComponent \n\nTaskListComponent \n\nTaskListComponent  -->\n\nTaskListModule->TaskListComponent \n\n\n\nTabsModule -->\n\nTerminalModule->TabsModule\n\n\n\n\n\nTerminalComponent \n\nTerminalComponent \n\nTerminalComponent  -->\n\nTerminalModule->TerminalComponent \n\n\n\n\n\nTabService\n\nTabService\n\nTabsModule -->\n\nTabService->TabsModule\n\n\n\n\n\nTaskListComponent\n\nTaskListComponent\n\nTaskListModule -->\n\nTaskListComponent->TaskListModule\n\n\n\n\n\nTaskListService\n\nTaskListService\n\nTaskListComponent -->\n\nTaskListService->TaskListComponent\n\n\n\n\n\nTerminalComponent\n\nTerminalComponent\n\nTerminalModule -->\n\nTerminalComponent->TerminalModule\n\n\n\n\n\nTopBarComponent\n\nTopBarComponent\n\nTerminalModule -->\n\nTopBarComponent->TerminalModule\n\n\n\n\n\nNodePtyService\n\nNodePtyService\n\nTerminalComponent -